import { useState } from "react";

const defaultState = {
  activJewelry: false,
  activClock: false,
  activBrend: false,
  activAromat: false,
  activIzdelia: false,
};

const ACTIVE_JEWELRY = "ACTIVE_JEWELRY";
const ACTIVE_CLOCK = "ACTIVE_CLOCK";
const ACTIVE_PERFUME = "ACTIVE_PERFUME";
const ACTIVE_LeatherProducts = "ACTIVE_LeatherProducts";

export const BurgerUrl = (state = defaultState, action) => {
  switch (action.type) {
    case ACTIVE_JEWELRY:
      return { ...state, activJewelry: action.payload };
    case ACTIVE_CLOCK:
      return { ...state, activClock: action.payload };
    default:
      return state;
  }
};

export const activeJewelryAction = (payload) => ({
  type: ACTIVE_JEWELRY,
  payload,
});
export const activeClockAction = (payload) => ({
  type: ACTIVE_CLOCK,
  payload,
});
